import React from 'react';
import "./MaterialCard.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faThumbsUp, faThumbsDown, faDownload } from '@fortawesome/free-solid-svg-icons';

function MaterialCard(props){
    return (
        <div className="material-card-container">
            <div className="material-card-center">
                <img src={props.imgUrl} alt={props.sloganText}/>
                <div><h3>{props.sloganText}</h3></div>
                <div>
                    <span> {props.likes} </span>
                    <button type="button"><FontAwesomeIcon icon={faThumbsUp} /></button>
                    <span> {props.dislikes} &nbsp; </span>
                    <button type="button"><FontAwesomeIcon icon={faThumbsDown}/></button>
                    
                    <button type="button"><FontAwesomeIcon icon={faDownload}/></button>
                </div>
            </div>
        </div>
    )
}

export default MaterialCard
